sys_variable_value.value:
(function execute(inputs, outputs) {

var payload = {}

if (inputs.message) { payload.message = inputs.message.toString() } 
if (inputs.max_chunks) { payload.maxchunks = input.max_chunks.toString() } 
if (inputs.sign_with) { payload.sign = inputs.sign_with } 
//if (inputs.sign_with[0] != "") { payload.sign = inputs.sign_with } //inconsistent

gs.info("payload " + JSON.stringify(payload))

outputs.cmd = JSON.stringify(payload)

})(inputs, outputs);

